import React, { Component } from "react";

class Cars extends Component {
  constructor() {
    super();
    this.state = {
      cars: [
        { id: "ferrari", name: "Ferrari" },
        { id: "benz", name: "Benz" },
        { id:"bmw", name: "BMW"},
        { id:"lombor", name: "Lombor"},
        { id:"ford", name:"Ford"}, 
      ],
    };
  }
  render() {
    const { cars } = this.state;
    return (
      <div>
        <h1>My Cars:</h1>
        {cars.map((car) => (
          <p key={car}>A car from {car} company</p>
        ))}
      </div>
    );
  }
}

export default Cars;
